import React from "react";
import "./App.scss";
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Pit from './components/login/login_register'

class App extends React.Component {
  constructor(props) {
    super(props);
  }



  render() {
    return (
      <BrowserRouter>
      <div className="App">
        <Route exact path="/" component={Pit}/>
      </div>
      </BrowserRouter>

    );
  }
}



export default App;
